"use strict";(function(){let navigationLink=$(".navigation").find("a");let footerLink=$(".footer-menu").find("a");navigationLink.click(function(){let target=$(this).attr("data-target");let index=$(this).parent().index();$("html, body").animate({scrollTop:$(target).offset().top},500*(index+1))});footerLink.click(function(){let target=$(this).attr("data-target");let index=$(this).parent().index();$("html, body").animate({scrollTop:$(target).offset().top},500*(index+1))});$("#contact-form").on("submit",function(a){a.preventDefault();let user={name:$("#name").val(),lastName:$("#lastname").val(),email:$("#email").val(),message:$("#message").val()};console.log(user)})}());